import React, { useContext  }  from 'react';
import './App.css'
import './App.css';
import Searche from './components/Searche'
import { LoanTable } from './components/LoanTable';
import DataContext from './context/data-context';



function App() {
 const ctx=useContext(DataContext)
 console.log(ctx.savedData.length);
  return (
    <React.Fragment>
      <section>
        <Searche/>
        <div className='control'>
          <p>განახლებული სესხების რაოდენობა</p>
          <button>დათვლა</button>
          <input type='text' placeholder='რაოდენობა'/>
        </div>
      </section>
      {ctx.savedData.length===0 && <section><p>მონაცემი ვერ მოიძებნა</p></section>}
      {ctx.savedData.length!==0 && <section><LoanTable /></section>}
      
    </React.Fragment>
  );
}

export default App;
